import { Link } from "../Link";
export function Activities() {
  const lineateWebSiteLink = "https://lineate.ru/";
  return (
    <>
      <div>
        <Link href={lineateWebSiteLink}>Lineate Team Member</Link>
        <p>Occupied software engineer position</p>
      </div>
    </>
  );
}
